#include <stdio.h>

int strStr(char* haystack, char* needle)
{
	int i;
	char *s = haystack;

	if (!*needle)
		return 0;

	while (*s) {
		if (*s == *needle) {
			i = 0;
			while (s[i] && needle[i] && (s[i] == needle[i]))
				i++;
			if (!needle[i])
				return (s - haystack);
			if (!s[i])
				return -1;
		}
		s++;
	}

	return -1;
}

void test_case_0(void)
{
	char *s1 = "";
	char *s2 = "";
	printf("0: %d\n", strStr(s1, s2));
}

void test_case_1(void)
{
	char *s1 = "aaa";
	char *s2 = "";
	printf("0: %d\n", strStr(s1, s2));
}

void test_case_2(void)
{
	char *s1 = "";
	char *s2 = "aaa";
	printf("-1: %d\n", strStr(s1, s2));
}

void test_case_3(void)
{
	char *s1 = "aaa";
	char *s2 = "aa";
	printf("0: %d\n", strStr(s1, s2));
}

void test_case_4(void)
{
	char *s1 = "aa";
	char *s2 = "aaa";
	printf("-1: %d\n", strStr(s1, s2));
}

void test_case_5(void)
{
	char *s1 = "0123456789aaaaaaaaa";
	char *s2 = "aaa";
	printf("10: %d\n", strStr(s1, s2));
}

void test_case_6(void)
{
	char *s1 = "";
	char *s2 = "";
	printf("-1: %d\n", strStr(s1, s2));
}

int main(int argc, char *argv[])
{
	test_case_0();
	test_case_1();
	test_case_2();
	test_case_3();
	test_case_4();
	test_case_5();
	test_case_6();
	return 0;
}
